import "./ExpenseItem.css";

var d = new Date();
let date = d.getDate + "/" + d.getMonth + "/" + d.getFullYear;
function ExpenseItem() {
  return (
    <div className="div">
      <div className="date">{date}</div>
      <div className="innerdiv ">
        <p>CAR ENSURANCE</p>
      </div>
      <div className="cost">Rs 1500</div>
    </div>
  );
}

export default ExpenseItem;
